import React from 'react';

function Header() {
  const handleLogoutClick = () => {
    console.log("Logout button is clicked");
  };

  return (
    <header className="flex flex-wrap gap-5 justify-between px-10 py-2 w-full bg-white border-b border-solid border-gray-300 max-md:px-5 max-md:max-w-full">
      <div className="flex gap-8 self-start">
        <h1 className="text-2xl text-indigo-800 basis-auto">We CureIt</h1>
        <span className="px-3 py-1 my-auto text-xs font-thin leading-4 text-gray-600 whitespace-nowrap rounded-full border border-gray-500 border-solid">
          Admin
        </span>
      </div>
      {/* Logout button with onClick handler */}
      <button 
        onClick={handleLogoutClick} // Logs message to console
        className="px-10 py-2 text-sm font-thin leading-5 text-center text-white whitespace-nowrap bg-indigo-500 rounded-full max-md:px-5"
      >
        Logout
      </button>
    </header>
  );
}

export default Header;
